    <title>Document</title>
    <style>
        body{
            background-color: #fff;
        }
        #imgBox{
            position: relative;
            margin: 0 auto;
            width: 600px;
            height: 600px;
            padding: 10px;
            background-color: transparent;
        }
        #imgBox div{
            float: left;
            width: 6px;
            height: 6px;
            opacity: .5;
        }
</style>
<script>
    window.onload=function(){
        randomColor();
        //随机赋色
        function randomColor(){
            var sum=parseInt(Math.random()*1000);
            var index=0;
            while(true){
            //sum次循环来给所有的div赋随机色
            for(var i=0;i<sum;i++){
                //
                var temp=parseInt(Math.random()*10000);

                //随机颜色
                var r=0;
                // r=parseInt(Math.random()*256);
                var g=0;
                // g=parseInt(Math.random()*256);
                var b=0;
                // b=parseInt(Math.random()*256);
                var rgb="rgb("+r+","+g+","+b+")";

                var oDiv=imgBox.getElementsByTagName("div")[temp];
                oDiv.style.backgroundColor=rgb;

                index++;
            }
            if(index>=sum) break;
        }
        }
        
    }
</script>
